data:
  definition: rapport, exprimé en valeur numérique ou en %, de la puissance maximale
    appelée par une installation ou un ensemble d'installations, au cours d'une période
    déterminée, à la puissance installée de cette installation ou de ces installations
  examples: []
  notes:
  - Il convient d'utiliser ce terme en précisant à quel niveau du réseau il se rapporte.
